import "../App.css";
import React from 'react';
import { useForm } from "react-hook-form";
import ExplorerHome from '../../src/ExplorerHome.png';
import { Link } from "react-router-dom"; 
import { useState, useEffect } from "react";
import Axios from "axios";





export default function Signup(props) {

  const { register, handleSubmit } = useForm();
  const onSubmit = (data) => {
    console.log(data);
    addMember(data);
  };

  const addMember = (data) => {
    Axios.post("http://localhost:3000/members", data).then(() => {
      props.setMembers([
        ...props.members,
        {
          data,
        },
      ]);
    });
  };
    return(
      <div className="add-members" style={{marginTop:"50px",width:"80%", background:"#6D7A69"}}>
            <center><h1> Create a Teeny Tiny Explorers Account</h1> </center>

            <form className="row" style={{margin: "25px 85px 75px 100px"}}>
                  <label>First Name</label>
                  <input type="text" 
                  placeholder="First Name" 
                  className="form-control" 
                  {...register( 'mbrfirstname', {required: true })}/>

                  <label>Last Name</label>
                  <input 
                  type="text" 
                  placeholder="Last Name" 
                  className="form-control" 
                  {...register( 'mbrlastname', {required: true })}/>


                  <label>Email</label>
                  <input type="email" 
                  placeholder="Enter email" 
                  className="form-control" 
                  {...register( 'email', {required: true })}/>


                  <label>Password</label>
                  <input type="text" 
                  placeholder="Password" 
                  className="form-control"
                  {...register( 'password', {required: true })}/>

                  <label>Mailing Address</label>
                  <input 
                  type="text" 
                  placeholder="Mailing Address" 
                  className="form-control"
                  {...register( 'address', {required: true })}/>





                  <label>City</label>
                  <input 
                  type="text" 
                  className="form-control"
                  {...register( 'city', {required: true })}/>


                  <label>County</label>
                  <input 
                  type="text" 
                  className="form-control" 
                  {...register( 'county', {required: true })}/>

                  <label>State</label>
                  <input 
                  type="text" 
                  className="form-control" 
                  {...register( 'state', {required: true })}/>

                  <label>Zip</label>
                  <input 
                  className="form-control" 
                  name="zip" 
                  type="text" 
                  {...register( 'zip', {required: true })}/>

                  />

                  <label>Phone Number</label>
                  <input className="form-control" type="phone" name="phonenumber" />

            <center>

              <input type="submit" value="Submit" className="btn btn-primary" style={{marginTop: "30px",background:"white", color:"black"}} />


              <input type="submit" value="Submit" className="btn btn-primary" style={{marginTop: "30px",background:"white", color:"black"}} />

            </center>

          </form>
    </div>
  );
};
